const ListItem = (props) => {
  const onDelete = (props) => {
    props.deleteHandler(props.id);
  };
  return (
    <div>
      <h1>{props.title}</h1>
      <p>{props.date}</p>
      <p>{props.description}</p>
      <button onClick={onDelete}>Delete</button>
    </div>
  );
};

export default ListItem;
